// function to calculate the sum of diagonal elements of a matrix
function f_gold(mat) {
    var n = mat.length;
    var res = 0;
    for (var i = 0; i < n; i++) {
        // add the diagonal element from top-left to bottom-right
        res += mat[i][i];
        // add the diagonal element from top-right to bottom-left, if it is not the same as the previous one
        if (n - i - 1 !== i) {
            res += mat[i][n - i - 1];
        }
    }
    return res;
}
